頭城城隍廟主祀城隍，人稱「安溪城隍」。安溪城隍係源自福建安溪，是福建地區最早的城隍廟，昔時即有「八閩第一」、「五邑無雙」之美譽。據頭城城隍廟沿革，道光年間自福德坑溪流下之城隍神像即安溪城隍。 　　頭城城隍廟中央神龕主祀城隍老爺，鎮殿神像頭帶官帽並披頭巾，身披紅色龍袍披風。另有一尊較為小型之神尊，即為福建安溪城隍。神龕前方有一木作香爐，銅錢狀爐耳刻有「昭和十年」字樣。頭城城隍老爺聖誕日為每年農曆正月初六日，安溪城隍聖誕日則是每年五月廿八日。

